// ==UserScript==
// @name        FimFic Ad Blocker
// @description Hides the ads on FimFiction
// @author      Sollace
// @namespace   fimfiction-sollace
// @include     http://www.fimfiction.net/*
// @include     https://www.fimfiction.net/*
// @version     1.1
// @grant       none
// ==/UserScript==

$('.ad_container').empty();
$('ins[id^="aswift_"]').empty();
var others = $('.right.list_boxes > .user-links ~ *:not(.content_box)');
others.find('a').first().after('<ins />');
others.remove();
$('ins[id^="aswift_"]').add('.ad_container').append('<div class="removed_add_placeHolder" />');

makeStyle('\
ins .removed_add_placeHolder {\
    border: 2px solid white;}\
.removed_add_placeHolder {\
    height: 100%;\
    width: 100%;\
    background: url(data:image/gif;base64,)\
    center / 100%;}\
.ad_container .removed_add_placeHolder {\
    height: 110px;\
    position: relative;}\
.removed_add_placeHolder:before {\
    content: "Hidden";\
    position: absolute;\
    top: 0px;\
    left: 0px;\
    background: rgba(120,120,180,0.6);\
    border-radius: 5px;\
    margin: 5px;\
    padding: 5px;}');

//==API FUNCTION==//
function makeStyle(input) {
    while (input.indexOf('  ') != -1) {
        input = input.replace('  ', ' ');
    }
    var style = document.createElement('style');
    $(style).attr('type', 'text/css');
    $(style).append(input);
    $('head').append(style);
}